import axios from "axios";
import React, { useState, useEffect } from "react";
import "./Main2.css";

function Main2() {
  const [hostels, setHostels] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:8000/hostel")
      .then((response) => {
        setHostels(response.data);
      })
      .catch((error) => {
        console.error("Error fetching hostels:", error);
      });
  }, []);

  return (
    <div className="carousel">
      <h2 className="categories__title">Hostels</h2>
      <div className="carousel__container">
        {hostels.map((hostel) => (
          <div className="carousel-item" key={hostel.id}>
            <img
              className="carousel-item__img"
              src={hostel.imageUrl}
              alt={hostel.name}
            />
            <div className="carousel-item__details">
              <div className="controls">
                <span className="fas fa-play-circle"></span>
                <span className="fas fa-plus-circle"></span>
              </div>
              <h5 className="carousel-item__details--title">{hostel.name}</h5>
              <h6 className="carousel-item__details--subtitle">{hostel.description}</h6>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Main2;
